・ リヤ専用ワイパー(スーパーグラファイト)<br>
・ メーカー:PIAA　-　品番:WG35RS<br>
・ 取付形状:RSタイプ　-　長さ:350mm<br>
・ 呼番:3RS　-　替ゴム呼番:3S<br>
<br>
☆ゴム表面にグラファイトコーティングを施すことにより、ガラス面との摩擦抵抗を軽減しスムーズな動きを実現。<br>
☆ 撥水コーティングを施工しているガラス、撥水コーティングをしていないガラスを問わず、優れた払拭性能を発揮します。<br><style type="text/css">
